import React, { useState } from 'react';
import leftNav from './LeftNav';
import './Burger.css';

const Burger = () => {
  const [open, setOpen] = useState(true);

  return (
    <>
      <div className={`burger ${open ? 'open' : ''}`} onClick={() => setOpen(!open)}>
      </div>
      <leftNav />
    </>
  );
};

export default Burger;
